        line1 : 'Baker Street',
        city : 'London',
        Country:'UK',
    },
    profiles :['twitter', 'linkedln', 'instagram'],
    printProfile: ()=> {
        person.profiles.map(
            (profile)=>{
                console.log(profile)
            }
        )
        console.log(person.profiles[0])
    }
}

